  return (
    <div className="font body ">

    <Container className="py-5 " >
    <Count persons={persons} />
    <Row className="justify-content-center">
    <Col sm="8" className="">
    <div className="box">

      <List persons={persons} />

    </div>
    </Col>
    </Row>
    <buttons />
    </Container>
    </div>
  );
}

export default App;
